window.bookSummaryJSON = "<p><b><i>The Stars Now Unclaimed</i></b><b> by Drew Williams is a fun, adventure-filled ride around a far-future galaxy.</b> <b>Think big guns, smugglers, epic space battles, and a telekinetic girl with all the gifts.</b>&nbsp;</p> <p>Jane Kamali is an agent for the Justified. Her mission: to recruit children with miraculous gifts in the hope that they might prevent the Pulse from once again sending countless worlds back to the dark ages.&nbsp;&nbsp;</p> <p>Hot on her trail is the Pax - a collection of fascist zealots who believe they are the rightful rulers of the galaxy and who remain untouched by the Pulse.&nbsp;&nbsp;</p> <p>Now Jane, a handful of comrades from her past, and a telekinetic girl called Esa must fight their way through a galaxy full of dangerous conflicts, remnants of ancient technology, and other hidden dangers.&nbsp;&nbsp;</p> <p>And that's just the beginning....</p>"; 
